import React from "react";

const Contact = () => {
  return (
    <section className="contact">
      <h2>Contactos</h2>
      <div className="contact-info">
        <div>
          <h4>Office Address</h4>
          <p>74A, High Road, Wienstreet, London</p>
        </div>
        <div>
          <h4>Telephone number</h4>
          <p>0976 45-81-100</p>
        </div>
        <div>
          <h4>Mail address</h4>
          <p>info@fisiohome.com</p>
        </div>
      </div>
    </section>
  );
};

export default Contact;
